ile we need to\n      // manually revoke the object URL to avoid memory leaks.\n      if (textFile !== null) {\n        window.URL.revokeObjectURL(textFile);\n      }\n\n      textFile = window.URL.createObjectURL(data);\n\n      return textFile;\n    };\n\n    var link = document.createElement('a');\n    // link.setAttribute('download', 'exoplots_download.txt');\n    link.setAttribute('target', '_blank');\n    link.href = makeTextFile(makeCSV(sources, keys, header));\n    document.body.appendChild(link);\n\n    // wait for the link to be added to the document\n    window.requestAnimationFrame(function() {\n      var event = new MouseEvent('click');\n      link.dispatchEvent(event);\n      document.body.removeChild(link);\n    });\n    "},"id":"1892","type":"CustomJS"},{"attributes":{"args":{"sources":[{"id":"1812"},{"id":"1821"},{"id":"1830"},{"id":"1839"},{"id":"1848"},{"id":"1857"},{"id":"1866"}]},"code":"\nconst nsources = sources.length;\nfor (let nn = 0; nn &lt; nsources; nn++) {\n    var source = sources[nn];\n    const nrows = source.selected.indices.length;\n    \n    for (let ii = 0; ii &lt; nrows; ii++) {\n        var ind = source.selected.indices[ii];\n        window.open(source.data['url'][ind]);\n        \n    }\n}\n"},"id":"1899","type":"CustomJS"},{"attributes":{"source":{"id":"1821"}},"id":"1828","type":"CDSView"},{"attributes":{"coordinates":null,"group":null,"text":"By Exoplots","x":-85,"x_units":"screen","y":32,"y_units":"screen"},"id":"1887","type":"Label"},{"attributes":{},"id":"1800","type":"ResetTool"},{"attributes":{},"id":"1799","type":"SaveTool"},{"attributes":{"button_type":"primary","icon":null,"js_event_callbacks":{"button_click":[{"id":"1892"}]},"label":"Download CSV of Selected Data"},"id":"1891","type":"Button"},{"attributes":{"overlay":{"id":"1802"}},"id":"1798","type":"BoxZoomTool"},{"attributes":{},"id":"1796","type":"PanTool"},{"attributes":{},"id":"1924","type":"UnionRenderers"},{"attributes":{},"id":"1801","type":"HelpTool"},{"
